Defendant in custody.   
Count 1 - Forgery - No contest plea.   
Count 2 - Utter Forged Check - No contest plea.   Convicted.   State moves to dismiss and read in counts 3, 4, 5, 6, and 7.  Motion granted.   
Count 1 - Defendant is sentenced to the Wisconsin State Prison System for a total sentence of four and one-half (4 1/2) years.   Eighteen (18) months initial confinement, followed by three (3) years extended supervision, concurrent with Case Files 15 CF 575 and 15 CF 685.   
Count 2 - Defendant is sentenced to the Wisconsin State Prison System for a total sentence of four and one-half (4 1/2) years.   Eighteen (18) months initial confinement, followed by three (2) years extended supervision, concurrent with Count 1 and Case Files 15 CF 575 and 15 CF 685.   Conditions of extended supervision are:
1) Assessment/treatment/counseling as deemed appropriate by the Department's assessment process;
2) AODA assessment and follow through counseling;
3) Submit to random urine screens and pay for same; 
4) Maintain absolute sobriety except for current prescribed medications for mental health;
5) Maintain full-time employment/schooling combination; 
6) Submit DNA sample and pay surcharge;
7) Obtain HSED/GED;
8) Pay costs of action; 
9) Pay supervision fees in an amount to be determined by DOC.  
Court finds the defendant is eligible for the Challenge Incarceration Program and the Substance Abuse Program.
